    if (status <= 0) {
        do:'$data(^$Job($ZPARENT)) $system.Process.Terminate($JOB, 0)
        continue
    }
    set data = $LISTGET(message, 2)
    set flag = $LISTGET(data, 1)
    set m = $LISTGET(data, 2)
    set str = str _ m
    quit:($LENGTH(m) '= ..#ChunkSize)
}
return $LISTBUILD(flag, str)

